def internalLogic(driver):
    reportDetails = driver.find_elements_by_class_name("report-data")[0]
    temp_dict = {}
    # net profit, total closed, percent profitable, profit factor, max drawdown, avg trade, avg number bars in trade
    temp = BeautifulSoup(reportDetails.find_elements_by_class_name("data-item")[0].get_attribute('innerHTML'), features="lxml").find({"span":{"additional-percent-value"}}).find_all({"span":{"class":"neg"}})
    if temp is not None and len(temp) > 0:
        temp_dict["net_profit"] = "-" + temp[0].string
    else:
        temp_dict["net_profit"] = BeautifulSoup(reportDetails.find_elements_by_class_name("data-item")[0].get_attribute('innerHTML'), features="lxml").find({"span":{"additional-percent-value"}}).string
    temp_dict["total_closed"] = BeautifulSoup(reportDetails.find_elements_by_class_name("data-item")[1].get_attribute('innerHTML'), features="lxml").find({"strong"}).string
    temp_dict["percent_profitable"] = BeautifulSoup(reportDetails.find_elements_by_class_name("data-item")[2].get_attribute('innerHTML'), features="lxml").find("strong").string
    temp_dict["profit_factor"] = BeautifulSoup(reportDetails.find_elements_by_class_name("data-item")[3].get_attribute('innerHTML'), features="lxml").find("strong").string
    temp = BeautifulSoup(reportDetails.find_elements_by_class_name("data-item")[4].get_attribute('innerHTML'), features="lxml").find({"span":{"additional-percent-value"}}).find_all({"span":{"class":"neg"}})
    if temp is not None and len(temp) > 0:
        temp_dict["max_drawdown"] = "-" + temp[0].string
    else:
        temp_dict["max_drawdown"] = BeautifulSoup(reportDetails.find_elements_by_class_name("data-item")[4].get_attribute('innerHTML'), features="lxml").find({"span"}).string
    
    temp = BeautifulSoup(reportDetails.find_elements_by_class_name("data-item")[5].get_attribute('innerHTML'), features="lxml").find({"span":{"additional-percent-value"}}).find_all({"span":{"class":"neg"}})
    if temp is not None and len(temp) > 0:
        temp_dict["avg_trade"] = "-" + temp[0].string
    else:
        temp_dict["avg_trade"] = BeautifulSoup(reportDetails.find_elements_by_class_name("data-item")[5].get_attribute('innerHTML'), features="lxml").find({"span"}).string
    temp_dict["avg_bars"] =  BeautifulSoup(reportDetails.find_elements_by_class_name("data-item")[6].get_attribute('innerHTML'), features="lxml").find({"strong"}).string
    for index in temp_dict:
        temp_dict[index] = re.sub(r'[^0-9\.-]',"", temp_dict[index])
    temp_dict["script"] = "https://www.tradingview.com" + strategy
    return pd.DataFrame(temp_dict, index=[0])

